  return (
    <div className="App">
        <Navbar  dark color="danger">
          <div className="container">
            <NavbarBrand href="/">Ristorante Con Fusion</NavbarBrand>
          </div>
        </Navbar>
        <Menu />
      </div>
  );
}

export default App;
